import React from "react";
import "./Navbar.scss";

function Navbar() {
  return (
    <div className="navbar">
      <div className="navbar-container">
        <div className="navbar-left-side">
          <span>PRODUCTS</span>
        </div>
        <div className="navbar-center-side">LAPTOP SHOP</div>
      </div>
    </div>
  );
}

export default Navbar;
